import React, { useState } from 'react';


const mockIncidents = [
  {
    id: 1,
    title: 'Incident 1',
    status: 'Open',
    description: 'Brief description of Incident 1',
    assignedStaff: 'John Doe',
  },
  {
    id: 2,
    title: 'Incident 2',
    status: 'In Progress',
    description: 'Brief description of Incident 2',
    assignedStaff: 'Jane Smith',
  },
  // Add more mock incidents as needed
];

const IncidentList = () => {
  const [selectedIncident, setSelectedIncident] = useState(null);

  const handleIncidentClick = (incident) => {
    setSelectedIncident(incident);
  };

  return (
    <div>
      <h1>Reported Incidents</h1>
      <ul>
        {mockIncidents.map((incident) => (
          <li key={incident.id} onClick={() => handleIncidentClick(incident)} style={{ cursor: 'pointer' }}>
            <strong>Title:</strong> {incident.title}<br />
            <strong>Status:</strong> {incident.status}<br />
            <strong>Assigned Staff:</strong> {incident.assignedStaff}<br />
            <p>{incident.description}</p>
          </li>
        ))}
      </ul>
      {selectedIncident && (
        <div>
          <h2>Selected Incident</h2>
          <strong>Title:</strong> {selectedIncident.title}<br />
          <strong>Status:</strong> {selectedIncident.status}<br />
          <strong>Assigned Staff:</strong> {selectedIncident.assignedStaff}<br />
          <p>{selectedIncident.description}</p>
        </div>
      )}
    </div>
  );
};

export default IncidentList;
